style.css:
* {
  color: #FFFFFF !important; /* Cambia el color de todas las letras a blanco */
  background-color: #FFC0CB !important; /* Cambia el color de fondo a rosa claro */
  border-color: #FFFFFF !important; /* Cambia el color de los bordes a blanco */
  box-shadow: 0 0 10px #FFFFFF !important; /* Cambia el color de las sombras a blanco */
}

img {
  filter: grayscale(100%) brightness(70%) sepia(100%) hue-rotate(300deg); /* Cambia el color de las imágenes a rosa */
}
